import {Link} from 'react-router-dom'
import { useSelector } from 'react-redux';
import { setToken } from '../store/slices/slice';
import { useDispatch } from 'react-redux';

function Navbar(){
    const token=useSelector(state=>state.global.token)
    const dispatch=useDispatch()
    return(
        <div className="flex justify-between p-4 bg-green-600 rounded-md">
            <div className='flex flex-col w-10 h-9 items-center justify-center'>
                <div className='m-1 w-full bg-white h-1'></div>
                <div className='m-1 w-full bg-white h-1' ></div>
                <div className='m-1 w-full bg-white h-1'></div>
            </div>
            {token
            ?
                <button className="border border-black border-2 bg-white p-1 text-md rounded-md w-20" onClick={()=>{localStorage.removeItem('token');dispatch(setToken(null))}}>
                    Logout
                </button>
            :
                <Link to="/login" >
                    <button className="border border-black border-2 bg-white p-1 text-md rounded-md w-20">Login</button>
                </Link>
            }
        </div>
    )
}
export default Navbar
